import './App.css';
import ColorBox from './ColorBox';
import ColorGrid from './ColorGrid';

const pastelColors = [
  "#FFDFD9",
  "#E6FFD9",
  "#E8D9FF",
  "#FFEBD9",
  "#D9FFFC",
  "#FFF5D9",
  "#D9FFE5",
  "#FFD9ED",
  "#E0FFD9",
  "#D9F2FF",
]

function App() {
  return (
    <ColorGrid colors={pastelColors}/>
  );
}

export default App;
